かいじゅうたちのいるところ コインバンク（貯金箱）/Where The Wild Things Are<br><table width="700" bgcolor="#000000"><tbody><tr><td width="150" align="right" bgcolor="075255"><font size="2" color="#FFFFFF">メーカー：</font></td><td width="550" bgcolor="073555"><font size="2" color="#FFFFFF">ドリームラッシュ</font></td></tr><tr><td width="150" align="right" bgcolor="075255" valign="top"><font size="2" color="#FFFFFF">サイズ：</font></td><td width="550" bgcolor="073555"><font size="2" color="#FFFFFF">マックス：160mm<br>キャロル：140mm</font></td></tr><tr><td width=150 align=right bgcolor=#075255 valign="top"><font color="#FFFFFF" size="2">詳細：</font></td><td width=550 bgcolor=#073555><font color=#FFFFFF size=2>マックスとキャロルの貯金箱<br>背中にコインを入れる穴があるタイプです。<br>子供への誕生日プレゼントや、その他ギフト等にも喜ばれますよ！</font></td></tr><tr valign="top" bgcolor="#E4FFEA"><td colspan="2" align="right"><div align="left"><font size="2" color="#666666"><b>【かいじゅうたちのいるところ】<br></b></font><font color="#FF6600" size="2"><b>世界中で50年近く愛され続ける“怪物絵本”</b></font><br><font color="#666666" size="2">20世紀最高の絵本と称される、絵本作家モーリス・センダックの代表作 『かいじゅうたちのいるところ』（原題『WHERE 
THE WILD THINGS ARE』）。 1963年に出版され、翌64年には世界三大絵本賞のひとつ「コルデコット賞」 金賞を受賞。現在までに世界中で2000万部を発行し、世代を超え、今なお愛され続けている名作です。</font></div></td></tr><tr valign="top" bgcolor="#FFFFFF"><td colspan="2" align="right"><center><table border="1"><tr><td colspan="2"><img src="http://image.rakuten.co.jp/ustoy/cabinet/kaijuu/drf60aa-1.jpg" alt="かいじゅうたちのいるところこいんばんくちょきんばこcoinbankchokinnbako"><br><img src="http://image.rakuten.co.jp/ustoy/cabinet/kaijuu/drf60aa-2.jpg" alt="かいじゅうたちのいるところこいんばんくちょきんばこcoinbankchokinnbako"></td></tr></table></center></td></tr></tbody></table>
